(function($,karmaBuilder){karmaBuilder.elementPanel=Backbone.View.extend({events:{"click .element-panel-add-element-button":"openAddElementView"},initialize:function(){this.setElement($('<div class="karma-element-panel-container">'));this.createAddElementPanel();this.createTemplatesPanel();this.createUnsplashPanel();this.render()},createAddElementPanel:function(){var template="<div>"+karmaBuilder.shortcodes.prototype.getWpTemplate("karma-element-panel-add-element",{})+"</div>";this.el.appendChild($(template)[0]);$(document).trigger("karma_finish_setting_panel_html",[this])},createTemplatesPanel:function(){var template="<div>"+karmaBuilder.shortcodes.prototype.getWpTemplate("karma-element-panel-templates",{})+"</div>";this.el.appendChild($(template)[0]);$(document).trigger("karma_finish_setting_panel_html",[this])},createUnsplashPanel:function(){var template="<div>"+karmaBuilder.shortcodes.prototype.getWpTemplate("karma-element-panel-unsplash",{})+"</div>";this.el.appendChild($(template)[0]);$(document).trigger("karma_finish_setting_panel_html",[this])},openAddElementView:function(){var addElement=document.querySelector(".karma-element-panel-add-element-view");if(null!=addElement){addElement.classList.add("element-panel-show")}},render:function(){document.body.appendChild(this.el)}})})(jQuery,karmaBuilder);